import React, { Fragment } from "react";
import { Form, Input, Header, Button } from "semantic-ui-react";
import "./App.css";

function App() {
  return (
    <Fragment>
      <nav>
        <div className="logo">
          <h2>TodoList</h2>
        </div>
      </nav>
      <div className="bf">
        <Header as="h1" className="header">
          Add Product
        </Header>

        <Form className="App"  size="large">
          <Form.Field width={6}  required >  
            <Input placeholder="Enter the task " fluid className="center"/>
          </Form.Field>
          <Button color="green"  inverted>Add Task</Button>
        </Form>
      </div>
    </Fragment>

    // <div>something</div>
  );
}

export default App;
